import React, { useState, useEffect } from 'react';
import { Route, HashRouter } from 'react-router-dom';
import NavigationBar from './components/Navigation/NavigationBar';
import './App.css';
import FoodDeliveryHome from './components/FoodDelivery/FoodDeliveryHome';

function App() {
  return (
    // Route the root url so that it displays our list of resources
    // Layout tags are included so that headers and footers are also displayed
    <React.Fragment>
      <NavigationBar></NavigationBar> 
      <HashRouter>
        <Route exact path='/' render={ () => (<FoodDeliveryHome />)}/>
      </HashRouter>
    </React.Fragment>
  );
}

export default App;
